func TestBlobManager_Download(t *testing.T) {
	var ctx = context.Background()
	type fields struct {
		BlobStore blobmanager.BlobStore
	}
	type args struct {
		ctx      *context.Context
		fileName string
	}
	tests := []struct {
		name    string
		fields  fields
		args    args
		want    blobmanager.File
		wantErr bool
	}{
		// TODO: Add test cases.
		{
			name: "download",
			fields: fields{
				BlobStore: gcs.CreateGCSClient(&ctx, "gcs_creds.json", "7c204c0a-8d08-11ee-b9d1-0242ac120002-test"),
			},
			args: args{
				ctx:      &ctx,
				fileName: "test_674c9d65361369da5c4710d6",
			},
			want:    nil,
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			b := &blobmanager.BlobManager{
				BlobStore: tt.fields.BlobStore,
			}
			got, err := b.Download(tt.args.ctx, tt.args.fileName)
			if (err != nil) != tt.wantErr {
				t.Errorf("Download() error = %v, wantErr %v", err, tt.wantErr)
				return
			}

			fileContent, err := io.ReadAll(got)
			if err != nil {
				t.Errorf("ReadAll() error = %v", err)
			}

			base64 := base64.StdEncoding.EncodeToString(fileContent)
			fmt.Println("base64: " + base64)

			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("Download() got = %v, want %v", got, tt.want)
			}
		})
	}
}

